import React from "react";
import { Container } from "react-bootstrap";

class MainPage extends React.Component {
  render() {
    return (
      <div>
        <Container className="d-flex flex-column">
          <h1 className="m-2">Что такое FamilyTree?</h1>
        </Container>
      </div>
    );
  }
}

export default MainPage;
